      out.write("    <script>\r\n");
      out.write("        //图片上传\r\n");
      out.write("        var xhr;\r\n");
      out.write("\r\n");
      out.write("        //上传文件方法\r\n");
      out.write("        function UpladFile() {\r\n");
      out.write("            console.log(\"接收上传请求\");\r\n");
      out.write("            var fileObj = document.getElementById(\"file\").files[0] // js 获取文件对象\r\n");
      out.write("\r\n");
      out.write("            // CFF 上传的接口失败了。为啥？！\r\n");
      out.write("            var url = \"http://");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${slave_address}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("\"; // 接收上传文件的后台地址\r\n");
      out.write("            console.log(url)\r\n");
      out.write("            console.log(\"文件名: \", fileObj.name)\r\n");
      out.write("            var fileNameUri = encodeURIComponent(fileObj.name)\r\n");
      out.write("\r\n");
      out.write("            xhr = new XMLHttpRequest(); // XMLHttpRequest 对象\r\n");
      out.write("            xhr.open(\"post\", url, true); //post方式，url为服务器请求地址，true 该参数规定请求是否异步处理。\r\n");
      out.write("            xhr.setRequestHeader(\"token\", \"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${token}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("\")\r\n");
      out.write("            xhr.setRequestHeader(\"element_id\", \"");
      out.write((java.lang.String) org.apache.jasper.runtime.PageContextImpl.proprietaryEvaluate("${elementId}", java.lang.String.class, (javax.servlet.jsp.PageContext)_jspx_page_context, null, false));
      out.write("\")\r\n");
      out.write("            xhr.setRequestHeader(\"filename\", fileNameUri)\r\n");
      out.write("            xhr.onload = uploadComplete; //请求完成\r\n");
      out.write("            xhr.onerror = uploadFailed; //请求失败\r\n");
      out.write("            xhr.upload.onprogress = progressFunction;//【上传进度调用方法实现】\r\n");
      out.write("            xhr.upload.onloadstart = function () {//上传开始执行方法\r\n");
      out.write("                ot = new Date().getTime(); //设置上传开始时间\r\n");
      out.write("                oloaded = 0;//设置上传开始时，以上传的文件大小为0\r\n");
      out.write("            };\r\n");
      out.write("            xhr.send(fileObj); //开始上传，发送form数据\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        //上传成功响应\r\n");
      out.write("        function uploadComplete(evt) {\r\n");
      out.write("            //服务断接收完文件返回的结果\r\n");
      out.write("            var data = JSON.parse(evt.target.responseText);\r\n");
      out.write("            if (data.success) {\r\n");
      out.write("                alert(\"上传成功！\");\r\n");
      out.write("            } else {\r\n");
      out.write("                alert(\"上传失败！\");\r\n");
      out.write("            }\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        //上传失败\r\n");
      out.write("        function uploadFailed(evt) {\r\n");
      out.write("            alert(\"上传失败！\");\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        //取消上传\r\n");
      out.write("        function cancleUploadFile() {\r\n");
      out.write("            xhr.abort();\r\n");
      out.write("        }\r\n");
      out.write("\r\n");
      out.write("        //上传进度实现方法，上传过程中会频繁调用该方法\r\n");
      out.write("        function progressFunction(evt) {\r\n");
      out.write("            var progressBar = document.getElementById(\"progressBar\");\r\n");
      out.write("            var percentageDiv = document.getElementById(\"percentage\");\r\n");
      out.write("\r\n");
      out.write("            // event.total是需要传输的总字节，event.loaded是已经传输的字节。如果event.lengthComputable不为真，则event.total等于0\r\n");
      out.write("            if (evt.lengthComputable) {//\r\n");
      out.write("                // progressBar.aria = evt.total;\r\n");
      out.write("                progressBar.style.width = evt.loaded+\"%\";\r\n");
      out.write("                percentageDiv.innerHTML = Math.round(evt.loaded / evt.total * 100) + \"%\";\r\n");
      out.write("            }\r\n");
      out.write("\r\n");
      out.write("            var time = document.getElementById(\"time\");\r\n");
      out.write("            var nt = new Date().getTime();//获取当前时间\r\n");
      out.write("            var pertime = (nt - ot) / 1000; //计算出上次调用该方法时到现在的时间差，单位为s\r\n");
      out.write("            ot = new Date().getTime(); //重新赋值时间，用于下次计算\r\n");
      out.write("            var perload = evt.loaded - oloaded; //计算该分段上传的文件大小，单位b\r\n");
      out.write("            oloaded = evt.loaded;//重新赋值已上传文件大小，用以下次计算\r\n");
      out.write("\r\n");
      out.write("            //上传速度计算\r\n");
      out.write("            var speed = perload / pertime;//单位b/s\r\n");
      out.write("            var bspeed = speed;\r\n");
      out.write("            var units = 'b/s';//单位名称\r\n");
      out.write("            if (speed / 1024 > 1) {\r\n");
      out.write("                speed = speed / 1024;\r\n");
      out.write("                units = 'k/s';\r\n");
      out.write("            }\r\n");
      out.write("\r\n");
      out.write("            if (speed / 1024 > 1) {\r\n");
      out.write("                speed = speed / 1024;\r\n");
      out.write("                units = 'M/s';\r\n");
      out.write("            }\r\n");
      out.write("            speed = speed.toFixed(1);\r\n");
      out.write("\r\n");
      out.write("            //剩余时间\r\n");
      out.write("            var resttime = ((evt.total - evt.loaded) / bspeed).toFixed(1);\r\n");
      out.write("            time.innerHTML = '，速度：' + speed + units + '，剩余时间：' + resttime + 's';\r\n");
      out.write("            if (bspeed == 0) time.innerHTML = '上传已取消';\r\n");
      out.write("        }\r\n");
